import './App.css';
import { Login, ProtectedRoute, Dashboard, Contact, Blog } from './Components';
import { Routes, Route } from "react-router-dom";
import React from 'react';

function App() {
  return (
    <div className="App">
      {/* <header className="App-header">
                  <img src={logo} className="App-logo" alt="logo" />
                  <p>
                    Edit <code>src/App.js</code> and save to reload.
                  </p>
                  <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Learn React
                  </a>
                </header> */}
      <Routes>
        <Route path='/'>
          <ProtectedRoute></ProtectedRoute>
        </Route>
        <Route path='/login'>
          <Login></Login>
        </Route>
        <Route
          path="/"
          element={
            <ProtectedRoute>
              <Dashboard></Dashboard>
            </ProtectedRoute>
          } />
        <Route
          path="/blog"
          element={
            <ProtectedRoute>
              <Blog />
            </ProtectedRoute>
          } />
        <Route
          path="/contact"
          element={
            <ProtectedRoute>
              <Contact />
            </ProtectedRoute>
          } />
      </Routes>
    </div>
  );
}

export default App;
